import React, { useEffect, useState } from "react";
import Loader from "./Loader";

const Price = () => {

    const [isLoader, setLoader] = useState(true);
    useEffect(() => {
        setTimeout(() => {
            setLoader(false)
        }, 2000)
    })

  return (
    <>
      {isLoader ?
                <><Loader />
                </> : <>

        <div className="Price">
            <div className="container">
                <div className="row">
                    <div className="col-12">

                    </div>
                </div>
            </div>
        </div>


                </>}
    </>
  );
};

export default Price;
